import styled from "styled-components"

export const Title = styled.h1`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    top: 32px;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
`;
export const Container = styled.div`
    background: yellow;
`;
export const TitleLeft = styled.h2`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: left;
`;
export const HeaderButtonLeft = styled.button`
    top: 32px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
`;
export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 32px;
`;
